import React, { Component } from 'react'
import { Users } from './Users';
import bootstrap from 'bootstrap';

//Planten Pagina
export class Planten extends Component {
    // comment
    render() {
        console.log(this.state);
        return (
            <div>
                <h2>{this.props.userData.user}</h2>
                <div className="row">
                    <div className="col">email:</div>
                    <div className="col">{this.props.userData.user}</div>            
                </div>
                <div className="row">
                    <div className="col">name:</div>
                    <div className="col">{this.props.userData.userId}</div>            
                </div>
                <div className="row">
                    <div className="col">email:</div>
                    <div className="col">{this.props.userData.user}</div>            
                </div>
            </div>
        )
    }
}

export default Planten
